description:
Un hochet pour bébé qui peut être accroché au berceau ou à la poussette. Tirez simplement sur l’anneau pour profiter du chant harmonieux de l’animal.
Particularités :
le hochet est réalisé en forme d’ours ;
la taille du jouet est de 10x2x27 cm ;
le jouet peut être suspendu à un berceau ou à une poussette ;
si vous le faites glisser facilement par l’anneau, le jouet jouera des mélodies ;
Il y a 12 mélodies au total ;
l’effet sonore fonctionne avec des piles (incluses) ;
le jouet est fait de plastique de haute qualité, sans danger pour la santé de l’enfant ;
Taille du paquet : 12 cm × 6 cm × 29 cm
